import React from "react";

import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";
const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  menuButton: {
    marginRight: "24px"
  },
  title: {
    flexGrow: 1,
    marginLeft: "24px"
  },
  test: {
    marginLeft: "24px",
    marginRight: "24px"
  },
  card: {
    backgroundColor: "red",
    spacing: 2
  }
}));
function Develop() {
  const classes = useStyles();
  return (
    <div className={classes.test}>
      <h1>This is Develop</h1>
      <Grid container>
        <Grid item xs={12}>
          <Card className={classes.card}>
            <h1>This is article</h1>
          </Card>
        </Grid>
        <Grid item xs={4}>
          <Card className={classes.card}>
            <h1>This is article</h1>
          </Card>
        </Grid>
        <Grid item xs={4}>
          <Card className={classes.card}>
            <h1>This is article</h1>
          </Card>
        </Grid>
        <Grid item xs={4}>
          <Card className={classes.card}>
            <h1>This is article</h1>
          </Card>
        </Grid>
        <Grid item xs={6}>
          <Card className={classes.card}>
            <h1>This is article</h1>
          </Card>
        </Grid>
        <Grid item xs={6}>
          <Card className={classes.card}>
            <h1>This is article</h1>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
}

export default Develop;
